    return(
    <div>
        <img style={{"width":"40vw", "height":"40vw", "marginTop":"-4.4%"}}
        src={require('../../assets/compass_with_p_blue_no_word.png')}/>
        <div style={{"marginLeft":"50%", "marginTop":"-30vw", "fontSize":"1.2vw", "textAlign": "center"}}
        >
        <h3> Portal de Dados Ambientais e Agropecuários da Mesorregião Oeste do Paraná </h3> 
        </div>
    </div>

    )
}
